import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import getPowerConsumption, {getMaxPowerConsumption, getAvrgPowerConsumption} from './PowerConsumption'
import getChartData from "./ChartData";


export default function BasicSelect() {
  const [selected, setSelected] = React.useState('');

  const handleChange = (event) => {
    setSelected(event.target.value);
  };
  const options = [];
  for (var i = 1; i <= 56; i++) {

    options.push(
      <MenuItem value={i}>{`Geraet ${i}`}</MenuItem>
    );
  }
  return (
     <div>
      <div className="DropDownListContainer">
    <Box className="DropDownList" sx={{ minWidth: 200, maxWidth:200}}>

      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Gerät</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={selected}
          label="Gerät"
          onChange={handleChange}
        >
          {options

          }

        </Select>
      </FormControl>

    </Box>
    </div>
    {getPowerConsumption(selected)}
            {getAvrgPowerConsumption(selected)}
            {getMaxPowerConsumption(selected)}
            {getChartData(selected)}
    </div>
  );
}
